window.bookSummaryJSON = "<p><b>A revolutionary quantum teleportation device promises to bring humanity one step closer to the stars.</b></p> <p><b>Until it fails. Spectacularly.</b></p> <p>Archaeologist Eliana Fisk is ripped from Earth while the whole world watches. She lands on a strange new world inhabited by a lost tribe of ancient Mayans. Meeting them, getting firsthand exposure to age-old customs and rituals...it seems like an archaeologistâ€™s dream.</p> <p>But what if their rituals have a darker meaning? What if the god these people pray to is no god at all? And how in the world will she ever get back home?</p> <p>Thus begins a pulse-pounding race against time that hurls Eliana into the great unknown, revealing ancient technologies and marvelous mysteries more outlandish than she ever imagined.</p> <p><i>The Translocator</i> is an action-packed sci-fi thriller perfect for fans of <i>Stargate</i>, <i>The Atlantis Gene</i>, and other archaeology-inspired science-fiction adventures.</p>"; 
